import './App.css';

import React, { Component } from 'react'

export default class App extends Component {
  render() {
    return (

      <div className='container mt-3 px-5 '>
        <div className=' flex-row bg-warning'>
          <div className='mr-4 float-start bg-inf'>
            123 Game
          </div>
           <button className='btn btn-danger btn-sm float-end'> New game</button>
        </div>
      </div>
    )
  }
}
